function buat(e){let t=document.createElement("script");t.innerHTML=e,document.body.appendChild(t)}async function jalankan(){var t,e="",e=(e+=document.head.innerHTML)+document.body.innerHTML;const a=new DOMParser,n=a.parseFromString(e,"text/html");for(t of n.querySelectorAll("script[type='magic']"))if(t.src)if(localStorage[t.src])buat(localStorage[t.src]);else{let e=await fetch(t.src);e=await e.text(),buat(localStorage[t.src]=e)}else buat(t.innerHTML)}jalankan();
